import{_ as e,c as o,o as r,d as n}from"./app.a9992a2c.js";const g='{"title":"FAQ","description":"","frontmatter":{},"headers":[{"level":2,"title":"FAQ","slug":"faq"}],"relativePath":"faq.md","lastUpdated":1636077271133}',a={},t=n('<h2 id="faq" tabindex="-1">FAQ <a class="header-anchor" href="#faq" aria-hidden="true">#</a></h2><h4 id="does-any-server-side-software-need-to-be-installed" tabindex="-1">Does any server side software need to be installed? <a class="header-anchor" href="#does-any-server-side-software-need-to-be-installed" aria-hidden="true">#</a></h4><p>For most of the TeamOne functionality no server side software is required to install. However if you install <strong>TeamOne Agent</strong> you will get additional features, like server health status data (RAM, CPU, disk size)</p><h4 id="will-any-of-my-data-be-sent-or-stored-on-any-3rd-party-servers" tabindex="-1">Will any of my data be sent or stored on any 3rd party servers? <a class="header-anchor" href="#will-any-of-my-data-be-sent-or-stored-on-any-3rd-party-servers" aria-hidden="true">#</a></h4><p>TeamOne stores temporary data using <a href="https://en.wikipedia.org/wiki/HTTP_cookie" target="_blank" rel="noopener noreferrer">cookies</a>. No data is being sent or stored on any servers.</p><h4 id="what-tm1-ibm-planning-analytics-version-is-supported" tabindex="-1">What TM1 \\ IBM Planning Analytics version is supported <a class="header-anchor" href="#what-tm1-ibm-planning-analytics-version-is-supported" aria-hidden="true">#</a></h4><p>Even though some functionality may work in the older versions, TeamOne add-on supports version IBM Planning Analytics 2.0.5 or newer.</p><h4 id="which-tm1-integratedsecuritymode-does-teamone-support" tabindex="-1">Which TM1 IntegratedSecurityMode does TeamOne support? <a class="header-anchor" href="#which-tm1-integratedsecuritymode-does-teamone-support" aria-hidden="true">#</a></h4><p>TeamOne supports the next TM1 integrated security modes: 1, 4, 5. If you don&#39;t specify <strong>namespace</strong> property of your environment definition, it will use mode 1 for connecting to TM1.</p><h4 id="teamone-add-on-not-working-when-signed-in-with-multiple-accounts" tabindex="-1">TeamOne add-on not working when signed in with multiple accounts <a class="header-anchor" href="#teamone-add-on-not-working-when-signed-in-with-multiple-accounts" aria-hidden="true">#</a></h4><p>Additionally you may see the following messages in Dev console:</p><ul><li>Exception: You do not have permission to access the requested document.</li><li>ERROR: Authorization is required to perform that action. (the error message can be different in different languagues) There is a limitation of add-ons when using multiple accounts. It is documented here: <a href="https://developers.google.com/apps-script/guides/projects#fix_issues_with_multiple_google_accounts" target="_blank" rel="noopener noreferrer">https://developers.google.com</a></li></ul><p>You can use one of the next workarounds:</p><ul><li>sing out from all accounts and sing it back first with the account you intend to use TeamOne add-on with</li><li>if using Google Chrome, use a separate profile</li><li>use a different browser for TeamOne add-on</li><li>use a new incognito window</li></ul><h4 id="teamone-add-on-not-working-dev-console-displays-we-re-sorry-a-server-error-occurred-while-reading-from-storage-error-code-permission-denied" tabindex="-1">TeamOne add-on not working. Dev console displays: We&#39;re sorry, a server error occurred while reading from storage. Error code PERMISSION_DENIED.? <a class="header-anchor" href="#teamone-add-on-not-working-dev-console-displays-we-re-sorry-a-server-error-occurred-while-reading-from-storage-error-code-permission-denied" aria-hidden="true">#</a></h4><p>This is a random error when trying to access Google script functions. Try the following to resolve it:</p><ul><li>re-open your Google sheet and try opening TeamOne sidebar or TeamOne Code again</li><li>re-login to your Google account, re-open your Google sheet and try opening TeamOne sidebar or TeamOne Code again</li></ul><h4 id="teamone-add-on-not-working-in-incognito-window" tabindex="-1">TeamOne add-on not working in incognito window <a class="header-anchor" href="#teamone-add-on-not-working-in-incognito-window" aria-hidden="true">#</a></h4><p>You may also see the next error in Dev console: Error in v-on handler: &quot;SecurityError: Failed to read the &#39;localStorage&#39; property from &#39;Window&#39;: Access is denied for this document.&quot; TeamOne add-on is using cookies and it may be blocked by your browser, for instance under Chrome&#39;s Settings &gt; Privacy &gt; Content settings, you have the cookie setting set to &quot;Block sites from setting any data&quot;</p><hr><p>Succeedium\xAE TeamOne 2021 | <a href="https://succeedium.com/teamone/privacy" target="_blank" rel="noopener noreferrer">Privacy Policy</a> | <a href="https://succeedium.com/teamone/terms" target="_blank" rel="noopener noreferrer">Terms Of Service</a></p>',21),i=[t];function s(d,l,c,h,u,p){return r(),o("div",null,i)}var f=e(a,[["render",s]]);export{g as __pageData,f as default};
